import React from 'react'; 
import classes from './SideDrawer.module.css';
const sideDrawer = props => {
    let sideDrawer = null;
    if (props.show){
        sideDrawer = <div className={classes.SideDrawer}></div>
    }
    return sideDrawer;
}

export default sideDrawer;
